<script type="text/javascript">
    var Happy = new Vivus("svg", {
                type: 'oneByOne', duration: 1000, start: 'manual',
                animTimingFunction: Vivus.EASE_OUT, // EASE, EASE_IN, EASE_OUT and EASE_OUT_BOUNCE
    });
    Happy.play();
    var $Photo = document.getElementById("Photo");
    var $Img = document.getElementById("Img");
    var $SVG = document.getElementById("svg");
    $Photo.style.opacity = 0;
    $Photo.style.visibility = "visible";
    $Img.style.opacity = 0;
    $Img.style.visibility = "visible";
    $SVG.style.opacity = 0;
    $SVG.style.visibility = "visible";
    var ms = new Date();
    var tida = 0, dati = 0;
    SecCounter();
    function SecCounter() {
        tida = (new Date() - ms)/100;
        if( tida <= 40){
            $SVG.style.opacity = Math.pow(tida/40,1.5);
        }
        if( tida > 75){
            $Img.style.opacity = Math.pow((tida-75)/75,2) / 5;
        }
        if (tida < 150) {
            var autotimer = setTimeout(SecCounter, 100);
            tida++;
        }
        else {
            ms = new Date();
            $Photo.style.top = window.innerWidth/20 + "px";
            transform();
        }
    }
    function transform() {
        dati = (new Date() - ms)/50;
        $SVG.style.strokeOpacity = Math.pow((60 - dati) / 60,2);
        $Img.style.opacity = 0.2 + 0.8 * dati / 60;
        $Photo.style.opacity = 1 * dati / 60;
        console.log("da ti");
        if (dati < 60) {
            var autotimer = setTimeout(transform, 50);
            dati++;
        }
    }
</script>
